import React from 'react';
import { Routes, Route } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Login from './pages/Login';
import SignUp from './pages/SignUp';
import Profile from './pages/Profile';
import ChangePassword from './pages/ChangePassword';
import AdminDashboard from './pages/AdminDashboard';
import Cart from './pages/Cart';
import Wishlist from './pages/Wishlist';
import ReferralPage from './pages/ReferralPage';
import OrderHistory from './pages/OrderHistory';
import { CartProvider } from './context/CartContext';
import { FavoritesProvider } from './context/FavoritesContext';
import { WishlistProvider } from './context/WishlistContext';
import Chatbot from './components/Chatbot';
import FoodItemDetail from './pages/FoodItemDetail';

function App() {
  const isUserSignedIn = !!localStorage.getItem('token');

  return (
    <CartProvider>
      <FavoritesProvider>
        <WishlistProvider>
          <div className="App">
            <Navbar />
            <Routes>
              <Route path='/' element={<Home />} />
              <Route path='/login' element={<Login />} />
              <Route path='/signup' element={<SignUp />} />
              {isUserSignedIn && <Route path='/profile' element={<Profile />} />}
              {isUserSignedIn && <Route path='/change-password' element={<ChangePassword />} />}
              {isUserSignedIn && <Route path='/admin' element={<AdminDashboard />} />}
              {isUserSignedIn && <Route path='/cart' element={<Cart />} />}
              {isUserSignedIn && <Route path="/wishlist" element={<Wishlist />} />}
              {isUserSignedIn && <Route path="/referral" element={<ReferralPage />} />}
              {isUserSignedIn && <Route path="/orders" element={<OrderHistory />} />}
              
              {isUserSignedIn && <Route path="/food-item/:id" element={<FoodItemDetail />} />}
            </Routes>
            {isUserSignedIn && <Chatbot />}
          </div>
        </WishlistProvider>
      </FavoritesProvider>
    </CartProvider>
  );
}

export default App;
